import{_ as a,o as r,c as n,z as e,a as t}from"./chunks/framework.9482e208.js";const x=JSON.parse('{"title":"§ 27-98.3 Duration of warrant.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/27-98.3.md","filePath":"vacode/27-98.3.md"}'),o={name:"vacode/27-98.3.md"},i=e("h1",{id:"§-27-98-3-duration-of-warrant",tabindex:"-1"},[t("§ 27-98.3 Duration of warrant. "),e("a",{class:"header-anchor",href:"#§-27-98-3-duration-of-warrant","aria-label":'Permalink to "§ 27-98.3 Duration of warrant."'},"​")],-1),s=e("p",null,"An inspection warrant shall be effective for the time specified therein, for a period of not more than seven days, unless extended or renewed by the judicial officer who signed and issued the original warrant. The judicial officer may extend or renew the inspection warrant upon application for extension or renewal setting forth the results which have been obtained or a reasonable explanation of the failure to obtain such results. The extension or renewal period of the warrant shall not exceed seven days. The warrant shall be executed and returned to the clerk of the circuit court of the city or county wherein the inspection was made. The return shall list any samples taken pursuant to the warrant. After the expiration of such time, the warrant, unless executed, shall be void.",-1),c=e("p",null,[t("1988, c. 549; 2014, c. "),e("a",{href:"http://lis.virginia.gov/cgi-bin/legp604.exe?141+ful+CHAP0354",target:"_blank",rel:"noreferrer"},"354"),t(".")],-1),l=[i,s,c];function h(d,f,u,p,_,w){return r(),n("div",null,l)}const b=a(o,[["render",h]]);export{x as __pageData,b as default};
